// 引入要用的框架
import Vue from 'vue'
// 引入App组件
import App from './App.vue'

// 关闭Vue的生产提示
Vue.config.productionTip = false

// 给 Vue.prototype 增加一个变量x
Vue.prototype.x = {a:1,b:2}


// 创建vm
new Vue({
    el:'#app',
    render: h => h(App)
})
